import React,{useEffect} from 'react';
import { Link } from 'react-router-dom';
import {useHistory} from 'react-router-dom';

const Home = () => {
  const history = useHistory();

  useEffect(() => {
  
    history.push('/users');
  },[])
  return (
    <div>Home</div>
  )
}

export default Home
